/* Function  structure for function  `func_complete_sale` */

/*!50003 DROP FUNCTION IF EXISTS `func_complete_sale` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`sys`@`%` FUNCTION `func_complete_sale`(p_client_id int,p_sale_id int(11),p_empoyee_id int) RETURNS smallint(6)
BEGIN    
    
    DECLARE v_return_id SMALLINT(6);
    declare v_trans_dateime datetime;
    declare v_payment_amount, v_payment_amount_1 decimal(15,2);
    
    SET v_return_id=1;
    set v_trans_dateime = now();
    
    -- set v_payment_amount = CONVERT(TRIM(SUBSTRING_INDEX(p_payment,';',1)),decimal(15,2));
    -- SET v_payment_amount_1 = CONVERT(TRIM(SUBSTRING_INDEX(p_payment,';',-1)),decimal(15,2));
    
    /*** Saving to `account_receivable` ***/    
    insert into `account_receivable`(`account_id`,`employee_id`,`trans_id`,`trans_amount`,`trans_code`,`trans_datetime`,`trans_status`)
    SELECT ac.id account_id,t1.employee_id,sale_id,total,'CHSALE' trans_code,sale_time,'N' trans_status
    FROM (SELECT s.id sale_id,s.sale_time,s.client_id,s.employee_id,si.currency_code,SUM(si.quantity*si.price) total
          FROM sale s, sale_item si
          WHERE s.id=p_sale_id
          AND s.id = si.sale_id
          GROUP BY s.id,s.sale_time,s.client_id,si.currency_code,s.employee_id
	 ) t1 JOIN account ac ON ac.client_id = t1.client_id    
	 AND ac.currency_code = t1.currency_code;
	 
    /* update `account` table */	 
    UPDATE account c, (
       SELECT s.client_id,si.currency_code,SUM(si.quantity*si.price) total
       FROM sale s, sale_item si
       WHERE s.id=p_sale_id
       AND s.id = si.sale_id
       GROUP BY client_id,si.currency_code
    ) AS s
    SET c.current_balance = c.current_balance + s.total
    WHERE c.client_id = s.client_id
    AND c.currency_code = s.currency_code;
    
    /*
    if v_payment_amount <> 0 then
	CALL pro_payment(p_client_id,3,v_payment_amount,p_empoyee_id);
    end if;
    
    if v_payment_amount_1 <> 0 then
	CALL pro_payment(p_client_id,2,v_payment_amount_1,p_empoyee_id);
    end if;
    */
    	
    /*
    update account c, (
	SELECT t1.client_id,t1.account_id,si.currency_code,SUM(price*quantity) total
	FROM (
	   SELECT s.id sale_id,s.client_id,ac.id account_id
	   FROM sale s, account ac
	   WHERE s.id=p_sale_id
	   AND s.client_id = ac.id
	) t1 INNER JOIN sale_item si ON t1.sale_id = si.sale_id
	GROUP BY t1.client_id,t1.account_id,si.currency_code
        ) as s
    set c.current_balance = c.current_balance + s.total
    where c.id = s.account_id
    and c.current_code = s.currency_code;
    */
    	
    RETURN v_return_id;    
    
    END */$$
DELIMITER ;

