/*!50003 DROP FUNCTION IF EXISTS `func_cu_item_schedule` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `func_cu_item_schedule`(i_item_id INT(11)) RETURNS smallint(6)
BEGIN    
    
    DECLARE p_trans_datetime DATETIME;
    DECLARE p_return_id SMALLINT(6);
    
    SET p_trans_datetime = NOW();
    SET p_return_id=1;
	
	INSERT INTO item_count_schedule(item_id,`name`,quantity,first_count_date,next_count_date,count_interval,employee_id)	
	SELECT item_id,`name`,quantity,first_count_date,next_count_date,count_interval,employee_id
	FROM (
		SELECT item_id,`name`,quantity,first_count_date,
		       DATE_ADD(next_count_date,INTERVAL count_interval DAY) next_count_date,
		       employee_id,count_interval
		FROM (
		SELECT i.id item_id,i.`name`,i.quantity,i.count_interval,`status`,
		       CASE WHEN ic.first_count_date IS NULL THEN p_trans_datetime
			    ELSE ic.first_count_date
		       END first_count_date,
		       p_trans_datetime next_count_date,
		       2 employee_id
		FROM item i LEFT JOIN item_count_schedule ic
			ON ic.item_id=i.`id`
	        WHERE i.id=i_item_id
		    ) AS t2
		WHERE `status`='1'
	) AS t1
	ON DUPLICATE KEY UPDATE quantity=t1.quantity,
		next_count_date=t1.next_count_date,
		count_interval=t1.count_interval,
		employee_id=t1.employee_id,
		modified_date=p_trans_datetime;
	
	INSERT INTO item_count_schedule_dt(item_id,`name`,quantity,first_count_date,next_count_date,count_interval,employee_id,remarks)	
	SELECT item_id,`name`,quantity,first_count_date,next_count_date,count_interval,employee_id,'CU ITEM' remarks
	FROM (
		SELECT item_id,`name`,quantity,first_count_date,
		       DATE_ADD(next_count_date,INTERVAL count_interval DAY) next_count_date,
		       employee_id,count_interval
		FROM (
		SELECT i.id item_id,i.`name`,i.quantity,i.count_interval,`status`,
		       CASE WHEN ic.first_count_date IS NULL THEN p_trans_datetime
			    ELSE ic.first_count_date
		       END first_count_date,
		       p_trans_datetime next_count_date,
		       38 employee_id
		FROM item i LEFT JOIN item_count_schedule ic
			ON ic.item_id=i.`id`
	        WHERE i.id=i_item_id		
		    ) AS t2
		WHERE `status`='1'
	) AS t1;
	
	RETURN p_return_id;    
    
    END */$$
DELIMITER ;

/* Function  structure for function  `func_payment` */

/*!50003 DROP FUNCTION IF EXISTS `func_payment` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`sys`@`%` FUNCTION `func_payment`(p_client_id INT,p_currency_code INT,p_payment_amount DECIMAL(15,2),p_empoyee_id INT) RETURNS smallint(6)
BEGIN
  DECLARE v_sale_id, v_client_id, v_currency_code,v_payment_id,v_account_id,v_return_id INT;
  DECLARE done INT DEFAULT FALSE;
  DECLARE v_payment_amount,v_balance DECIMAL(15,2);
  DECLARE v_sale_time,v_tran_datetime DATETIME;
 
  #declare cursor
  DECLARE cur1 CURSOR FOR SELECT s.sale_id,s.sale_time,s.currency_code,client_id,( s.total-IFNULL(sp.payment_amount,0) ) balance
  FROM (SELECT s.id sale_id,s.sale_time,s.client_id,s.employee_id,si.currency_code,SUM(si.quantity*si.price) total
        FROM sale s, sale_item si
        WHERE s.id = si.sale_id
        AND s.client_id = p_client_id
        AND si.currency_code=p_currency_code
        GROUP BY s.id,s.sale_time,s.client_id,si.currency_code,s.employee_id
    ) s LEFT JOIN v_sale_payment sp ON sp.sale_id=s.sale_id AND s.currency_code = sp.currency_code
  WHERE ( s.total-IFNULL(sp.payment_amount,0) ) > 0;
  #declare handle 
  DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;
  
  SET v_payment_amount := p_payment_amount;
  SET v_tran_datetime := NOW();
  SET v_return_id:=1;
  
  SELECT id INTO v_account_id FROM account WHERE client_id=p_client_id AND currency_code=p_currency_code;
  
  #update account - account_balance
  UPDATE account 
  SET current_balance = current_balance - p_payment_amount
  WHERE id = v_account_id;
  
  #insert to payment history
  INSERT INTO payment_history(`client_id`,currency_code,`payment_amount`,`give_away`,`date_paid`,`employee_id`)
  VALUES (p_client_id,p_currency_code,p_payment_amount,0,v_tran_datetime,p_empoyee_id);
  
  SELECT LAST_INSERT_ID() INTO v_payment_id;
  
  #open cursor
  OPEN cur1;
 
  #starts the loop
  the_loop: LOOP
 
    #get the values of each column into our variables
    FETCH cur1 INTO v_sale_id,v_sale_time,v_currency_code,v_client_id,v_balance;
    IF done THEN
      LEAVE the_loop;
    END IF;
 
    #processing criterion
    IF v_payment_amount<=v_balance THEN
	#insert it
	INSERT INTO sale_payment(`sale_id`,`currency_code`,`payment_id`,`payment_type`,`payment_amount`,`give_away`,`date_paid`,`modified_date`)
	VALUES (v_sale_id,v_currency_code,v_payment_id,'cash',v_payment_amount,0,v_tran_datetime,v_tran_datetime);
	INSERT INTO `account_receivable`(`account_id`,`employee_id`,`trans_id`,`trans_amount`,`trans_code`,`trans_datetime`,`trans_status`)
	VALUES (v_account_id,p_empoyee_id,v_sale_id,v_payment_amount,'PAY',v_tran_datetime,'N');
	
	SET done = TRUE;
    ELSE 
        SET v_payment_amount:= v_payment_amount - v_balance;
        INSERT INTO sale_payment(`sale_id`,`currency_code`,`payment_id`,`payment_type`,`payment_amount`,`give_away`,`date_paid`,`modified_date`)
	VALUES (v_sale_id,v_currency_code,v_payment_id,'cash',v_balance,0,v_tran_datetime,v_tran_datetime);	
	INSERT INTO `account_receivable`(`account_id`,`employee_id`,`trans_id`,`trans_amount`,`trans_code`,`trans_datetime`,`trans_status`)
	VALUES (v_account_id,p_empoyee_id,v_sale_id,v_balance,'PAY',v_tran_datetime,'N');	
	
    END IF;
 
  END LOOP the_loop;
   
  CLOSE cur1;
  
  RETURN v_return_id;
  
  END */$$
DELIMITER ;

